Документ определяет порядок решения вопросов назначения государственных пенсий, применения пенсионных льгот, перерасчета, восстановления, выплаты, вычета из пенсии, обеспечения граждан пенсиями и другими выплатами.

Администрация организаций ежегодно в декабре на основании личных ведомостей и трудовых книжек составляет списки работников, которые в следующем году будут иметь право на пенсию как на общих, так и на льготных условиях.

Гражданин вправе обратиться с просьбой о назначении пенсии в любое время со дня возникновения права на пенсию, не ограничиваясь каким-либо сроком.

Не допускается, чтобы отделение Пенсионного фонда принимало решение о проверке имеющихся данных для назначения пенсии, когда информация, необходимая для назначения (перерасчета) пенсии, была получена:

- из накопительной пенсионной системы;

- из электронного централизованного реестра индивидуального учета страховых взносов, перечисляемых в Пенсионный фонд;

- из электронного централизованного реестра индивидуального учета заработной платы граждан;

- из межведомственного аппаратно-программного комплекса единой национальной системы труда и информационных систем других министерств и ведомств.
